Input : A sequence of n numbers <a1​,a2​,...,an​> Output : A permutation of the input sequence such that the numbers are in increasing order. The numbers to be sorted are also known as keys because they are often associated with other data sometimes called satellite data . Both key and satellite data together form a record. // A = Array (1..n)
// n = Array size.
INSERTION-SORT(A, n) // Iterate forward. for unsorted-idx = 2 to n key = A[unsorted-idx] sorted-idx = unsorted-idx - 1 // Iterate backwards. // Shift sorted items down while larger than key. while (sorted-idx > 0) and (A[sorted-idx] > key) A[sorted-idx + 1] = A[sorted-idx] sorted-idx = sorted-idx - 1 A[sorted-idx + 1] = key Loop Invariant - A formal statement or property of a program loop that is true before and after each iteration. At the start of each iteration of the above for loop, the subarray A[1:unsorted-idx - 1] consists of the elements originally in A[1:unsorted-idx - 1] but in sorted order. Loop invariants help understand why an algorithm is correct. Three things are needed: Initialization: The property must be true prior to the first iteration of the loop. Maintenance: If the property is true before an iteration, it remains true before the next iteration. Termination: The loop terminates, upon which, the invariant and the reason that the loop terminates gives us a useful property that helps show that the algorithm is correct.

